// miniprogram/pages/layout/notice/received/received.js
const app = getApp();
Page({
  data: {
    received: [],
    style: '',
    name: '',
    date: null,
    time: null,
    title: null,
    content: null,
    receivedOne: null,
    noticedetail_jpg: "data:image/jpg;base64,"
  },

  onLoad: function(options) {
    console.log(app.globalData.notice_detail)
    if (app.globalData.userinfo['type'] === "admin") {
      this.setData({
        userType: 1,
        status: app.globalData.notice_detail
      })
    } else {
      this.setData({
        userType: 0,
        received:app.globalData.notice_detail['received'],
        date: app.globalData.notice_detail['date'],
        time: app.globalData.notice_detail['time'],
        title: app.globalData.notice_detail['title'],
        content: app.globalData.notice_detail['content']
      })
    }
    console.log(this.data.received)
  },
  onShow: function(options) {

  },

  confirm: function() {
    console.log("confirmed")
    this.setData({
      received: 1
    })
    wx.request({
      url: "https://www.ningziqian.work:8000/notice_receive/",
      method: "POST",
      data: {
        user_no: app.globalData.userinfo['username'],
        notice_no: app.globalData.notice_detail['notice_no']
      },
      // 服务器返回信息，将信息存储至本地缓存
      success: function (res) {

      },
      fail: function (res) {
        console.log('submit fail');
      }
    })
  }
})